import{React, useState, useEffect}  from 'react';

function Contact(props) {
    const [number, setnumber] = useState("");


    useState (()=>{

        setnumber("056800008")
    },[])
    return (
        <div>
            <h1>Contact</h1>

            <h1>
                {number}
            </h1>

        </div>
    );
}

export default Contact;
